import React from 'react';

const Form = () => {
  return (
    <div>
      <form>
        <input type="text" name="name"></input>
        <input type="text" name="email"></input>
        <input type="text" name="subject"></input>
        <input type="text" name="message"></input>
        <button>submit</button>
      </form>
    </div>
  );
};
export default Form;
